import axios from "axios";
import MaterialTable from "material-table";
import React, { useEffect, useState } from "react";
import { onRowUpdate } from "@material-ui/icons";
import logo from "../image/logo.png";
const Product = () => {
  const columns = [
    { title: "Title", field: "title" },
    { title: "Category", field: "" },
    { title: "Price", field: "price" },
    { title: "Offer Price", field: "offer_price" },
    { title: "Photo", field: "photo", render: (rowData) => <img alt="" src={logo} /> },
    { title: "Created By", field: "created_by", render: (rowData) => rowData.created_by.name },
    { title: "Status", field: "status" },
    { title: "Created At", field: "created_at" },
  ];

  const [data, setData] = useState([]);
  useEffect(() => {
    getData();
  }, []);

  const getData = () => {
    axios.get("https://groceryshop-api.herokuapp.com/api/product").then((res) => {
      setData(res.data.data);
    });
  };
  console.log(data);

  return (
    <div style={{ width: "70%" }}>
      <MaterialTable columns={columns} data={data} editable={{ onRowUpdate }} />
    </div>
  );
};

export default Product;
